import React from 'react'
import cl from './Pagination.module.scss'

function Pagination({ items }) {

	const countPage = items.length / 8
	return (
		<div className={cl.root}>
			<ul>
				<li>{countPage}</li>
			</ul>
		</div>
	)
}

export default Pagination
